import './App.css';

import { createGlobalStyle } from 'styled-components';
import { BrowserRouter, Router } from 'react-router-dom'


const GlobalStyle = createGlobalStyle`
  body {
    margin: 0;
  }
`;

function App() {
  return (
    <>
      <GlobalStyle />
      <BrowserRouter>
        <Router/>
      </BrowserRouter>
    </>
  );
}

export default App;
